using namespace std;


class Solution {
  public:
      string minWindow(string s, string t) {
        if (s.size() == 1  && s == t) {
          return s;
        }

        unordered_map<char, int> original_needed;
        unordered_map<char, bool> needed;
        unordered_map<char, int> found;
        
        for (int i = 0; i < t.size(); i++) {
          needed[t[i]] = true;
          original_needed[t[i]]++;
        }

        int ptr1 = 0;
        int ptr2 = 0;
        if (original_needed.count(s[ptr2])) {
          found[s[ptr2]]++;
        }


        int output_size = INT_MAX;
        pair<int,int> output_ptrs = {-1, -1};
        while (ptr2 < s.size()) {
          if (needed.count(s[ptr2]) && original_needed[s[ptr2]] <= found[s[ptr2]]) {
            needed.erase(s[ptr2]);
          }

          if (needed.size() != 0) {
            ptr2++;
            if (original_needed.count(s[ptr2])) {
              found[s[ptr2]]++;
            }
            continue;
          }

          // Add solution if best
          if (ptr2 - ptr1 + 1 < output_size) {
            output_size = ptr2 - ptr1 + 1;
            output_ptrs = {ptr1, ptr2};
          }

          // Check if the current start is a necessary value
          if (original_needed.count(s[ptr1])) {
            found[s[ptr1]]--;
            if (found[s[ptr1]] < original_needed[s[ptr1]]) {
              needed[s[ptr1]] = true;
            }
          }
          ptr1++;
          // TODO: Can optimize and increment ptr1 to the next required char
          
        }

        string output;
        if (output_size == INT_MAX) {
          output = "";
        } else {
          output = s.substr(output_ptrs.first, output_ptrs.second - output_ptrs.first + 1);
        }
        return output;
      }
  };


template <typename T>
string vectorToString(const vector<T> &vec, const string &delimiter = ", ")
{
  ostringstream oss;
  for (size_t i = 0; i < vec.size(); ++i)
  {
    if (i > 0)
      oss << delimiter; // Add delimiter between elements
    oss << vec[i];
  }
  return oss.str();
}

template <typename T>
string gridToString(const vector<vector<T>> &grid, const string &rowDelimiter = "\n", const string &colDelimiter = ", ") 
{
  ostringstream oss;
  for (size_t i = 0; i < grid.size(); ++i) 
  {
    if (i > 0)
      oss << rowDelimiter; // Add row delimiter between rows

    for (size_t j = 0; j < grid[i].size(); ++j) 
    {
      if (j > 0)
        oss << colDelimiter; // Add column delimiter between elements
      oss << grid[i][j];
    }
  }
  return oss.str();
}


